INSERT INTO `category` VALUES ('1', '3D', 'http://www.iiijiaba.com/pic/category/3D.jpg', 'There are lots of 3d wallpapers in this app.Enjoy those amazing wallpapers for your smart phone!');
INSERT INTO `category` VALUES ('2', 'Aethetic', 'http://www.iiijiaba.com/pic/category/Aethetic.jpg', 'These beautiful photos discover beauty and give us the happy feeling.And they tell us that smile for what still remains.');
INSERT INTO `category` VALUES ('3', 'Aircraft', 'http://www.iiijiaba.com/pic/category/Aircraft.jpg', 'If you like the plane,you can find what you desire from this one.Just phone wallpaper,it can let you feel the cool feeling of flight.');
INSERT INTO `category` VALUES ('4', 'Animal', 'http://www.iiijiaba.com/pic/category/Animals.jpg', 'Awesome animal wallpapers!No animal on earth, it\'s a world without energy!Animals are our friends.');
INSERT INTO `category` VALUES ('5', 'Anime', 'http://www.iiijiaba.com/pic/category/Anime.jpg', 'Manga include a broad range of subjects: action-adventure,sports and games, horror,and others.Let the anime,enrich your life!');
INSERT INTO `category` VALUES ('6', 'Cars', 'http://www.iiijiaba.com/pic/category/Car.jpg', 'The wallpaper of cars are carefully selected for people who like cars. Cool cars, let you feel the aura of the solidification!');
INSERT INTO `category` VALUES ('7', 'Children', 'http://www.iiijiaba.com/pic/category/Children.jpg', 'Now is the era of adorable baby in power,here offer you lots of adorable baby wallpapers, there is always one you love!');
INSERT INTO `category` VALUES ('8', 'City', 'http://www.iiijiaba.com/pic/category/Cities.jpg', 'If you do not travel, you can\'t feel the world\'s numerous and complicated, also won\'t be able to know what is the real meet!');
INSERT INTO `category` VALUES ('9', 'Fantasy', 'http://www.iiijiaba.com/pic/category/Fantasy.jpg', 'Imagination that we can do anything. Come on! Let us rush into this appealing space!\r\n');
INSERT INTO `category` VALUES ('10', 'Female', 'http://www.iiijiaba.com/pic/category/Female.jpg', 'As long as pleasing to the eye is the beauty; Only good is the wind.Actress of section,there is always a moment let you scream!');
INSERT INTO `category` VALUES ('11', 'Flag', 'http://www.iiijiaba.com/pic/category/Flags.jpg', 'Soldiers,no matter in front or rear,there is a flag not flapping from their hearts forever.I love the national flag waving in the wind!');
INSERT INTO `category` VALUES ('12', 'Food', 'http://www.iiijiaba.com/pic/category/Foods.jpg', 'Food is very powerful healing powers.All kinds of delicacies you can find here are providing strength for you.');
INSERT INTO `category` VALUES ('13', 'Graffiti', 'http://www.iiijiaba.com/pic/category/Graffiti.jpg', 'Sometimes graffiti can express one\'s feelings, anger or happy. No matter what,please forgive me for such unbridled doodle!');
INSERT INTO `category` VALUES ('14', 'Holiday', 'http://www.iiijiaba.com/pic/category/Holiday.jpg', 'Huge amounts of elegant holiday wallpapers, and they can let your phone also full of holiday atmosphere.');
INSERT INTO `category` VALUES ('15', 'Love', 'http://www.iiijiaba.com/pic/category/Love.jpg', 'I love you not for who you are,but for who I am with you.About love,there are many definitions: love is poetry and the sun in life.');
INSERT INTO `category` VALUES ('16', 'Macro', 'http://www.iiijiaba.com/pic/category/Mcro.jpg', 'Macro refers to extreme close-up images,usually of small subjects,in which the size is greater than life size.');
INSERT INTO `category` VALUES ('17', 'Men', 'http://www.iiijiaba.com/pic/category/Men.jpg', 'This section,you can find your favorite male star.And,show your passion for him,let his photo appear on your android device.');
INSERT INTO `category` VALUES ('18', 'Mood', 'http://www.iiijiaba.com/pic/category/Mood.jpg', 'Rich emotional wallpapers.Your emotions can be expressed through these beautiful wallpapers!');
INSERT INTO `category` VALUES ('19', 'Motor', 'http://www.iiijiaba.com/pic/category/Motor.jpg', 'Cool motorcycle wallpaper collection to share with you,if you are a motorcycle fans,enjoy and set into your mobile phone!');
INSERT INTO `category` VALUES ('20', 'Nature', 'http://www.iiijiaba.com/pic/category/Nature.jpg', 'A wide-ranging assortment of artistic images about nature from graphic artists and photographers from around the world.');
INSERT INTO `category` VALUES ('21', 'Retro', 'http://www.iiijiaba.com/pic/category/Retro.jpg', 'Spruce up your mobile phone with the most beautiful costumes! Turn your phone into the retro style!');
INSERT INTO `category` VALUES ('22', 'Roads', 'http://www.iiijiaba.com/pic/category/Road.jpg', 'No matter the city\'s bustling road ,or the nature road of green trees and wild flowers,each has its unique charm!');
INSERT INTO `category` VALUES ('23', 'Sexy', 'http://www.iiijiaba.com/pic/category/Sexy.jpg', 'They are shining,beauty and sexy stars.You can download the mobile phone wallpaper,let your phone also sexy!');
INSERT INTO `category` VALUES ('24', 'Sign', 'http://www.iiijiaba.com/pic/category/Sign.jpg', 'Here are a variety of signs,like,sports team marks,clothing,mobile phones, computers and so on.So,you can\'t miss it!');
INSERT INTO `category` VALUES ('25', 'Space', 'http://www.iiijiaba.com/pic/category/Space.jpg', 'The outside space adventure,never-ending journey!Save to your device as wallpaper,so you can always have a view of space.');
INSERT INTO `category` VALUES ('26', 'Sport', 'http://www.iiijiaba.com/pic/category/Sport.jpg', 'The most popular sport in the world, on your phone\'s background.Get your best favourite sport photo to be your wallpaper!');
INSERT INTO `category` VALUES ('27', 'Weapon', 'http://www.iiijiaba.com/pic/category/Weapon.jpg', 'Although the heavy guns, threw it away, life has become more heavy. A wide variety of weapons,just customized for you!');
